import React from "react";
import { View, StyleSheet } from "react-native";

function NavButtonSection(props) {
	return (
		<View style={styles.container}>
			<View style={styles.buttonContainer}>
				<View style={styles.navButton}></View>
				<View style={styles.navButton}></View>
				<View style={styles.navButton}></View>
			</View>
		</View>
	);
}

const styles = StyleSheet.create({
	container: {
		position: "absolute",
		bottom: 0,
		height: "20%",
		width: "9%",
		borderColor: "black",
		borderWidth: 1,
	},
	buttonContainer: {
		flexDirection: "row",
		alignItems: "center",
		justifyContent: "space-evenly",
		width: "100%",
		borderColor: "green",
		borderWidth: 1,
	},
	navButton: {
		backgroundColor: "blue",
		width: 80,
		height: 80,
		borderRadius: 50,
	},
});

export default NavButtonSection;
